    // StackOverflow
    private void flip(char[][] grid, int x, int y) {
        if (x < 0 || x > grid.length - 1) {
            return;
        }
        if (y < 0 || y > grid[0].length - 1) {
            return;
        }
        if (grid[x][y] == 'O') {
            grid[x][y] = '$';
            flip(grid, x - 1, y);
            flip(grid, x + 1, y);
            flip(grid, x, y - 1);
            flip(grid, x, y + 1);
        }
    }

    private void flip2(char[][] grid, int x, int y) {
        if (grid[x][y] != 'O') {
            return;
        }
        Stack<Integer> xStack = new Stack<>();
        Stack<Integer> yStack = new Stack<>();
        xStack.push(x);
        yStack.push(y);
        while (!xStack.empty()) {
            int x1 = xStack.pop();
            int y1 = yStack.pop();
            if (x1 < 0 || x1 > grid.length - 1) {
                continue;
            }
            if (y1 < 0 || y1 > grid[0].length - 1) {
                continue;
            }
            if (grid[x1][y1] == 'O') {
                grid[x1][y1] = '$';
                xStack.push(x1 - 1);
                yStack.push(y1);
                xStack.push(x1 + 1);
                yStack.push(y1);
                xStack.push(x1);
                yStack.push(y1 - 1);
                xStack.push(x1);
                yStack.push(y1 + 1);
            }
        }
    }

    public void solve(char[][] board) {
        if (board == null || board.length == 0)
            return;

        // 从边界出发翻转所有O为$
        for (int i = 0; i < board.length; i++) {
            if (board[i][0] == 'O') {
                flip2(board, i, 0);
            }
        }
        for (int i = 0; i < board.length; i++) {
            if (board[i][board[0].length - 1] == 'O') {
                flip2(board, i, board[0].length - 1);
            }
        }
        for (int j = 0; j < board[0].length; j++) {
            if (board[0][j] == 'O') {
                flip2(board, 0, j);
            }
        }
        for (int j = 0; j < board[0].length; j++) {
            if (board[board.length - 1][j] == 'O') {
                flip2(board, board.length - 1, j);
            }
        }

        // 翻转所有非$的O
        for (int i = 0; i < board.length; i++) {
            for (int j = 0; j < board[i].length; j++) {
                if (board[i][j] == 'O') {
                    board[i][j] = 'X';
                }
            }
        }

        for (int i = 0; i < board.length; i++) {
            for (int j = 0; j < board[i].length; j++) {
                if (board[i][j] == '$') {
                    board[i][j] = 'O';
                }
            }
        }
    }
